def apply_model(X_train, X_test, y_train, y_test):
  """
  function for wrap all ML algorithm implement in this research
  output :
    - Logistic Regression
    - Decision Tree 
    - Random Forest
    - Xgboost Classifier
    note :
      - metrics evaluation = classification_report, accuracy_score: type list
      - each ML model is default
  """
  # define ML Algorithm
  models = {"Logistic Regression":LogisticRegression(),
           "Decision Tree":DecisionTreeClassifier(),
           "Random Forest":RandomForestClassifier(),
           "Xgboost":XGBClassifier()}
  # training model, testing model, and get accuracy
  list_acc = []
  for algo in models:
    print(algo)
    model = models[algo].fit(X_train, y_train)
    test = model.predict(X_test)
    list_acc.append(accuracy_score(y_test, test))
    print(classification_report(y_test, test))
    print("=="*30)
    print()
  result = pd.DataFrame({"Model":models.keys(),
                        "Accuracy":list_acc})
  return result

first_result = apply_model(X_train, X_test, y_train, y_test)

